import React from 'react';
import { BrowserRouter as Router} from 'react-router-dom';
import Route from 'react-router-dom/Route';

import Login 			from '/src/components/systemSecurity/Login.js';
import ConfirmOtp  		from '/src/components/systemSecurity/ConfirmOtp.js';
import ForgotPassword 	from '/src/components/systemSecurity/ForgotPassword.js';
import ResetPassword 	from '/src/components/systemSecurity/ResetPassword.js';
import SignUp 			from '/src/components/systemSecurity/SignUp.js';
import VerifyEmail 		from '/src/components/systemSecurity/VerifyEmail.js';


function RouterLinks() {
  return (
  	<Router>	
  		<Route path="/" 			exact strict component={ Login } />
  		<Route path="/login" 		exact strict component={ Login } />
  		<Route path="/signup" 		exact strict component={ SignUp } />
  		<Route path="/forgot-pwd" 	exact strict component={ ForgotPassword } />
  		<Route path="/reset-pwd" 	exact strict component={ ResetPassword } />
  		<Route path="/verify-email" exact strict component={ VerifyEmail } />
  		<Route path="/confirm-otp" 	exact strict component={ ConfirmOtpModal } />
  	</Router>
  );
}

export default RouterLinks;
